const styles = theme => ({
    root: {
        ...theme.mixins.gutters(),
        paddingTop: theme.spacing.unit * 2,
        paddingBottom: theme.spacing.unit * 2,
    },
    rowForIndicators:{
        display:"inline-block"
    },
    title:{
        marginBottom:"20px"
    },
    date:{
        marginBottom:"20px"
    },


});
export default styles;
